import drawMap from "@/components/drawMap";
import httpClient from "@/utils/httpclient";
export default {
    name: 'lotEdit',
    components: {
        drawMap
    },
    data() {
        return {
            data: null
        }
    },
    mounted(){
        httpClient.get("/api/v1/lot/detail", {
            params: {
                id: this.$route.params.id
            }
        }).then(response => {
            this.data = response.data.data;
        })
    },
}
